	"0x2701C353E2BA": "当检查或调整节气门位置开关怠速位置或节气门位置传感器怠速位置时，此功能可以监视这些项.\\n请按维修手册基本检查步骤进行.",
	"0x2701C353E2C1": "当发动机从2000转/分降至怠速时检查碰摩转速。\\n通过旋转开关体调整碰摩转速。",
	"0x2701C353E2C3": "怠速时按开始后怠速空气控制阀-怠速提升电磁阀被断电.在下列状态下设定发动机转速额定值.\\n-发动机充分暖机\\n-无负荷",
	"0x2701C353E2C9": "在下列条件下将发动机转速设定在额定值.\\n-发动机充分暖机\\n-无负荷",
	"0x2701C353E2CC": "怠速时按开始将停止燃油泵.发动机停转后再启动几次.",
	"0x2701C353E2CE": "此功能允许清除自学习控制数值。\\n当发动机控制模块完成自学习时，此功能用法不当可能会导致驾驶性能变差\\n请遵循维修手册说明。",
	"0x2701C353E2D0": "按开始后点火正时回馈控制将保持.此后,用正时灯通过转动曲轴位置传感器调整点火正时",
	"0x2701C353E2F0": "此功能允许发动机控制模块学习怠速空气控制阀的位置以保持发动机的正常怠速.\\n\\n 凡更换怠速空气控制阀,节气门体,发动机控制模块或怠速或点火正时超过范围时,必须进行此功能. \\n\\n详细参见维修手册",
