	"0x2702C153E2C1": "当发动机从2000转/分降至怠速时检查碰摩转速。\\n通过旋转开关体调整碰摩转速。",
	"0x2702C153E2C3": "怠速时按开始后怠速空气控制阀-怠速提升电磁阀被断电.在下列状态下设定发动机转速额定值.\\n-发动机充分暖机\\n-无负荷",
