	"0x2713C153E3BA": "自动取消原因",
	"0x2781C150E243": "此功能可以清除自学习控制值.\\n 此功能不正当使用可能导致自学习完成时驾驶性能变坏.\\n按维修手册指导操作.",
	"0x2781C150E246": "此功能使发动机控制模块学习IACV-AACV位置以保持发动机以正常转数运转。在更换节气门体或发动机控制模块后,或当怠速点火正时在规定范围之外时，必须采用这种学习模式。执行此功能时必须符合以下条件。若有任一条件不符，调整过程都将无法完成。\\n1.电池电压:>12.9V(怠速).\\n2.发动机冷却温度:70-90摄氏度。\\n3.空档/停车档:开启\\n4.电力负荷开关:关闭。(空调，车头灯，后除霜器)\\n5.安有日间行车灯的车辆,请将灯开关调至1,只保留小灯打开。\\n6.扇风机:关闭。\\n7.方向盘:中间位置(一直向前).\\n8.车速:停止。",
	"0x2781C150E249": "当下列条件满足时按'开始'.\\n-发动机充分暖机\\n-变速器在'P'或 'N'\\n-发动机转速保持在3000rpm.",
	"0x2781C150E24F": "在下列条件下按开始，通风控制学习.\\n-发动机充分暖机\\n-档位在'P'或'N'\\n-发动机速度保持在2000转/分",
	"0x2781C150E356": "安装燃油管后断开喷油嘴驱动单元接头.\\n按'OK'键，直到燃油压力传感器压力达到标准范围才摇转启动发动机。（勿启动发动机)",
	"0x2781C150E367": "按开始后点火正时回馈控制将保持.此后,用正时灯通过转动曲轴位置传感器调整点火正时",
	"0x2781C150E368": "怠速时按开始将停止燃油泵.发动机停转后再启动几次.",
	"0x2781C150E370": "在下列条件下将发动机转速设定在额定值.\\n-发动机充分暖机\\n-无负荷",
	"0x2781C150E37C": "用带有压力表的手动泵从维修口向燃油蒸发排放系统供压.\\n切勿使用压缩空气或高压泵!\\n勿起动发动机.",
	"0x2781C150E3BA": "当检查或调整节气门位置开关怠速位置或节气门位置传感器怠速位置时，此功能可以监视这些项.",
	"0x2781C150E841": "确认点火开关开启且发动机已停止。在此步骤中需满足这些条件。\\n-按'OK'键",
	"0x2781C150E844": "按'开始'键并在以下条件中调整怠速点火正时。\\n发动机已变热。\\n负载(空调，灯等)已关闭。\\n注意:一般维修过程通常不需要此功能。",
	"0x2781C150E846": "在发动机怠速下设定一氧化碳值",
	"0x2781C150E847": "按'开始'键并在以下条件中调整怠速点火正时。\\n发动机已变热。\\n负载(空调，灯等)已关闭。\\n注意:一般维修过程通常不需要此功能。",
	"0x2781C150E850": "此功能允许改变ECM估算的乙醇混合气比率.\\n此功能不正确操作可能导致驾驶性变坏或增加油耗.\\n按维修手册指导操作.",
