	"0x2781C154E246": "2．执行节气门关闭位置学习。\\n\t\t1).加速踏板完全松开\\n\t\t2).点火ON \\n\t\t3).点火OFF 至少10 秒\\n\t\t4).等待节气门动作超过10秒。",
	"0x2781C155E246": "请再次确认条件！\\n1．电源电压正常。\\n2．水温70-100℃\\n3．PNP 开关在ON\\n4．关所有用电器\\n5．转向盘中间位置\\n6．变速器已预热",
	"0x2781C156E246": "发动机冷却液温度需要：70-99 ℃",
	"0x2781C157E246": "1．执行加速踏板松开位置学习。\\n\t\t1).加速踏板完全松开\\n\t\t2).点火ON 至少2秒\\n\t\t3).点火OFF 至少10 秒\\n\t\t4).重复2,3 操作 4次。",
	"0x2781C15AE246": "1.关闭点火开关至少10秒，确认加速踏板完全释放，将点火开关转到ON位置，等待3秒。\\n2.在5秒内迅速重复以下操作5次（完全踏下踏板，完全释放踏板）\\n3.等待7秒，完全踏下踏板保持约20秒，直到发动机灯停止闪烁并开始变亮。\\n4.MIL灯点亮后3秒内完全释放加速踏板。\\n5.启动发动机，使其怠速运转20秒以上。",
	"0x2782C150E243": "点火开关打开，发动机停止.",
