	"0x2782C150E24B": "仅当带DPF氧化催化剂更新时才执行此工作.",
	"0x2782C150E24C": "点火开关打开，发动机停止.",
	"0x2782C150E24F": "点火开关打开，发动机停止.\\n在执行此支持项目后,必须进行喷油嘴调整值注册.因为此支持项将初始化所有存储在ECM内的喷油嘴调整值.详细请参考维修手册.",
