	"0x278DC152E240": "当马达启动时，如果有显示以下内容则为正常.\\n\\n 前进: 换档杆 D,2,1\\n 停车: 换档杆P, N. \\n 后退: 换档杆R.\\n-打开停车制动.\\n-当发动机启动时进行.\\n-不要踩油门.",
