	"0x27AF0706140C": "VDC操作信号",
	"0x27AF07061410": "该测试的目的是检查每个汽缸和每个喷射器的效率。该测试用于检查燃烧室以及喷射器。\\n开始测试之前，请遵循下列指示：\\n-如果车辆配备手动变速箱，按下并释放离合器踏板\\n-车辆静止\\n-驻车制动器必须拉起\\n-对于手动变速箱，操纵杆置于空挡\\n-对于自动变速箱，操纵杆置于驻车挡\\n-发动机怠速运行\\n-冷却液温度高于70 ℃\\n测试过程中请勿在车辆上进行任何操作。\\n否则，测试将会取消。",
	"0x27AF07061412": "测试程序：测试可依次分为4个步骤，测试过程中，电脑会停止激活每个喷油器并增加发动机转速。\\n每一步均为自动进行。进行测试时严禁对车辆尤其是对发动机进行任何操作。\\n测试结果会总结在一个表格内。如果存在问题，请参考车辆的相关资料。",
	"0x27AF07061415": "检查泵的调压器配置，参数VP072。",
	"0x27AF07061417": "商用车怠速模式",
	"0x27AF0706141A": "仅在ECU存储器存在时使用该指令。一旦指令完成，关闭点火，等待诊断工具上的对话信息缺失，这样清除电脑存储器才能被注册。",
