	"0x27AF07062378": "ESP自动重连临界点",
	"0x27AF07062379": "传感器必须设定在下列条件下： - 点火开关打开且发动机关闭：将方向盘向右或向左转动20°以上。 - 重新转回方向盘：至中央位置，车轮笔直向前。请勿碰触方向盘。 -按下'确认'以启动指令 注：为使车轮正确位于笔直向前位置，请使用前轴调整工作台。 - 将点火开关关闭然后再打开。检查方向盘转角数值。 - 起动发动机。将方向盘向左转到底，再向右转到底。检查有无故障。",
	"0x27AF0706237A": "ESP传感器设定",
	"0x27AF0706237B": "'必须'选择车辆参数。根据下列资料输入 ESP 变量值并确认： -L1 - M9R 2.0 DCI 90/115CH - F9Q 1.9 DCI 100CH ESP 变量值=1 -L1 - G9U 2.5 DCI 115/150CH ESP 变量值=2 -L1 - F4R 2.0 16 V 120CH ESP 变量值=3 -L2 - M9R 2.0 DCI 90/115CH -F9Q 1.9 DCI 100CH ESP 变量值=4 -L2 - G9U 2.5 DCI 115/150CH ESP 变量值=5 -L2 - F4R 2.0 16 V 120CH ESP 变量值=6",
	"0x27AF0706237E": "故障码---纵向加速传感器",
	"0x27AF0706237F": "传感器必须设定在下列条件下： 1- 点火开关打开，发动机关闭。 2- 将车辆停放在平坦的水平地面上。 3- 使方向盘位于'车轮向前'位置，校正胎压，并释放手刹。 4- 车辆为空车状态，仅可有一人乘坐于驾驶座。 5- 按下'确认'以启动指令。 6- 关闭点火开关。检查有无故障。",
