	"0x27AF07062420": "故障码---低压燃油泵",
	"0x27AF07062421": "发动机运转缓慢。再生导致废气温度上升。内部必须使用针对高温的抽风机（耐400℃高温）。再生也可能产生气味和烟雾。建议在室外对车辆进行再生操作。务必在非易燃性地面（机油、落叶）上进行再生。排气管附近严禁放置任何物体。该指令增加最大怠速并产生振动。从管道升温阶段到再生阶段，发动机有噪音变化是正常现象。指令至少持续30分钟（冷却液加热时间将使再生时间变长）。警告 \\n- 再生过程中须关闭所有用电设备。 \\n为避免发动机高速空转，务必确保油位在最小和中等液位之间。紧急情况下：可通过短按车辆启动按钮两次（少于3秒）停止再生。关闭点火开关并等待1分钟后再次打开点火开关。如发动机关闭时间大于1分钟，指令将终止。\\n\\n在再生操作的过程中：\\n-请勿断开诊断工具。\\n-请勿移动车辆。\\n-请勿踩下制动踏板。",
