	"0x27AF07062C4A": "车门开启",
	"0x27AF07062C51": "故障检测测试会检查高压泵的效率并确认高压燃油回路没有泄漏。 检查高压泵、油轨及喷油器。 开始测试前，请按照下列指示： - 车辆必须静止并使用驻车制动 - 手动变速箱：换至空档 - 自动变速箱：至于P档 - 发动机：怠速运转、关闭各个电气设备(关闭空调系统及加热式后挡风玻璃) -冷却液温度位于上下限之间（80-91°C） -燃油温度位于上下限之间（15-50°C） 在测试进行中，不可干预车辆。否则，测试会取消。",
	"0x27AF07062C52": "最大加速(RPM)",
	"0x27AF07062C53": "与平均值的偏差(RPM)",
	"0x27AF07062C56": "燃油回路测试过程中，不可操作车辆； 测试结束时，发动机可熄火",
	"0x27AF07062C5B": "故障码---催化系统",
	"0x27AF07062C60": "ECO 模式开关",
	"0x27AF07062C62": "超级娱乐型轿车（SSS）",
	"0x27AF07062C66": "4H开关",
	"0x27AF07062C68": "测试目的：诊断各汽缸和喷射器效率并检查燃烧室和喷射器。开始测试之前：\\n-如果车辆配备了手动变速箱，则踩下和释放离合器踏板。\\n-车辆处于静止状态，且驻车制动器已拉起。对于手动变速箱，将换挡杆置于空挡。\\n-对于自动变速箱，将换挡杆置于驻车挡，且发动机缓慢运行，冷却液温度处于范围之内（最低温度80 ℃（176 ℉），最高温度91 ℃（196 ℉））。\\n-燃油温度处于范围之内（最低温度15 ℃（59 ℉），最高温度50 ℃（122 ℉））。\\n测试过程中请勿在车辆上执行任何操作。否则测试取消。",
	"0x27AF07062C69": "测试步骤： 此测试可分为4个顺序，电脑会停止以控制各个喷油嘴并增加发动机转速。 所有的这些步骤都是自动的。 在测试进行时，不可对车辆或发动机的任一部位作任何的干预。 各个结构都会显示在总结表中 如果有问题，则查阅车辆的相关资料：",
	"0x27AF07062C6E": "-如果结果栏显示“有效”，这表明汽缸操作故障查找运行正确。\\n-如果结果栏显示“无效”，这表明汽缸操作故障查找运行错误。\\n参考车辆相关资料。",
	"0x27AF07062C6F": "若未遵守以下指示，测试无法启动：\\n-离合器踏板的动作，-车辆停止，-驻车制动刹紧，-发动机慢速运转。\\n-水温指示位于上下限之间(绿色指示)，-燃油温度位于上下限之间(绿色指示)。再次执行步骤。",
