	"0x27AF070653A2": "请勿删除 DTC 也不要拆下电池以避免警告灯记录被删除。 [诊断程序] \\n1. 请跟顾客确认是哪一个警告灯点亮。 如果很清楚是哪一个警告灯点亮时， \\n-> 请依据相关资料执行相关的诊断 如果不清楚是哪一个警告灯点亮时， \\n->请至 2 \\n2. 请确认警告灯记录 \\n-> 请针对出现在记录中的警告灯相关系统执行诊断",
