	"0x27AF070653BB": "燃油表诊断 (模拟指针)",
	"0x27AF070653BC": "[注意事项] 如果是以下的情况，可能需要经过一些时间才会显示实际温度。 所以，请确认顾客所示的情形是否是发生在以下的情况下。 \\n- 刚从较凉的区域进入较暖和的区域。 数据监控值是由外气温度传感器的输入信号转换而成的转换值。 所以，可能会与车辆信息显示器中的显示值有所不同。 (因为显示在车辆信息显示器中的外气温度是由外气温度传感器所输入的正确值。) \\n如果外气温度传感器曾被拆下或更换过，所显示的温度有时候会不正确，此时请执行以下的操作。 \\n请拆下 12V 电池负极端子，等待 30 秒，然后接上负极端子，再将点火开关切至 ON 并确认。 \\n如果有拆下 12V 电池的负极端子，请执行相关资料中所述的必要操作。",
	"0x27AF070653BD": "1. 外气温度显示检查 \\n1. 确认仪表中的外气温度显示值与数据监控中的外气温度输入值。 \\n如果仪表中的显示值高于数据监控中的输入值 仪表中的显示值 ＞ 数据监控中的输入值 -> 请执行症状诊断的车外温度显示不正确中所述的程序。 \\n如果仪表中的显示值低于数据监控中的输入值 仪表中的显示值 ＜ 数据监控中的输入值 -> 请在拆下 12V 电池负极端子，等待 30 秒，然后接上负极端子后，再比较仪表中的显示值与数据监控中的输入值 \\n如果数值相同，表示正常。 \\n如果数值不相同，请执行症状诊断的车外温度显示不正确中所述的程序。",
	"0x27AF070653BF": "1. 指标操作确认（模拟指针）。请根据以下步骤执行车载诊断，并确认燃油量表指针（模拟指针）是否在工作。车载诊断。\\n1.打开钥匙开关，切换短距离里程表至A或B。\\n2关闭钥匙开关。\\n3.按住里程表重置开关的同时打开钥匙开关。\\n4.确认 '0000.0'显示在短距离里程表上。\\n5.钥匙开关打开后，在7秒内按压里程表重置开关3次或以上。\\n6.当里程表重置开关被按下时，每个仪表都在运转。\\n->如果出现仪表不运转情况，请更换该仪表  \\n->如果每个仪表都运转，请根据系统诊断进行检查。",
