	"0x27AF07065810": "点火打开，发动机停止。仅在更换或编程电脑时使用此指令，用来保存部分数据（包括喷油器标定）以便自动下载到新电脑中。",
	"0x27AF07065811": "车速信息",
	"0x27AF07065812": "电控单元数据已保存。在维修后，更换电控单元后按照步骤输入数据。",
	"0x27AF07065813": "上一车辆的计算机数据备份文件已存储在工具中。是否要清除这一数据并使用当前车辆的数据进行替换？",
	"0x27AF07065814": "配置以下所需的选项。",
	"0x27AF07065818": "N/ALCTD",
	"0x27AF07065829": "快怠速功能必须在选择所需怠速并按下“确认”前激活。",
	"0x27AF0706582A": "电脑类型未知：\\n- 如果电脑已被（重）编程，请勿更换。\\n- 请使用最新诊断设备更新，然后重启脚本。\\n- 如果故障仍然存在，请联系技术支持。",
	"0x27AF0706582C": "记忆存储故障",
	"0x27AF0706582E": "已经进行配置。必须关闭 + 点火后3分钟，以便存储配置。",
	"0x27AF0706582F": "在保存数据前必须使用最新的诊断仪更新。否则会出现数据记录不起作用的风险。",
	"0x27AF07065834": "再生期间车辆移动了；请处理出现的故障。",
	"0x27AF07065838": "重要：售后再生期间请勿踩下制动踏板。",
	"0x27AF07065839": "重要： \\n- 必须关闭空调系统（再生故障风险）和其他耗电设备。\\n- 必须检查发动机机油液位，防止发动机超速风险。 机油液位应位于油标尺最小值与中间值之间。\\n- PF再生进行时必须关闭发动机罩。",
	"0x27AF0706583A": "若仪表板上的信息有相关要求，请换油。关闭点火开关并等待诊断工具的对话信息消失(最多9分钟)。\\n点火馈电之后重新激活强制+并执行“进行重装”指令，然后选择“使用诊断工具进行微粒过滤器再生之后”。\\n关闭点火开关并等待诊断工具的对话信息消失(最多9分钟)。点火馈电后重新激活强制+并清除故障。",
	"0x27AF0706583C": "微粒过滤器过载。更换微粒过滤器。\\n-启用“进行重装”指令并选择“微粒过滤器更换后”。\\n-关闭点火开关并等待诊断工具的指令信息消失（最多9分钟）。\\n-除非仪表板上的信息有相关要求，否则请勿排出机油.",
	"0x27AF0706583E": "微粒过滤器再生完成。\\n检查参数“再生后的碳烟”。如果大于15克且这是\\n-第一次再生：进行第二次再生。\\n-第二次再生：请求技术援助。\\n打开发动机罩，在两次再生之间让发动机冷却2个小时。\\n有关更换磨损部件的详情，请参阅参考手册。点击【确认】结束指令。",
	"0x27AF07065840": "期望",
	"0x27AF07065842": "转速超过1300转/分，仅在车里静止时保持怠速。当怠速在800和1300转/分之间时，输入0到18英里时 （30 公里/时）之间的速度（快怠速禁用阈值） 。",
	"0x27AF07065845": "发动机怠速起动。\\n该指令仅用于故障“微粒过滤器堵塞”或故障“再生故障已超出”。",
	"0x27AF07065847": "已达到最高或最低限制；所请求的修改无法完成。",
	"0x27AF07065848": "指令至少持续30分钟（再生时间将随冷却液加热时间增加）",
	"0x27AF0706584B": "再生导致废气温度上升。内部必须使用针对高温的抽风机（耐400℃高温）。再生也可能产生气味和烟雾。建议在室外对车辆进行再生操作。务必在非易燃性地面（机油、落叶）上进行再生。排气管附件严禁放置任何物体。",
	"0x27AF0706584D": "颗粒滤清器已堵塞：请更换颗粒滤清器。",
	"0x27AF0706584E": "在紧急情况下： 短按2次车辆启动按钮（少于3秒）可停止再生。关闭点火，等待1分钟后再打开点火。若发动机关闭1分钟以上，指令停止。重要 \\n- 在任何再生操作期间：\\n- 请勿断开诊断工具连接。\\n- 请勿移动车辆\\n- 请勿踩下制动踏板。",
