	"0x27AF07065887": "微粒过滤器再生成功。\\n关闭道路照明灯并停用乘客通风装置。\\n如需终止指令，请点击【确认】。",
	"0x27AF07065888": "汽油/天然气车辆",
	"0x27AF07065889": "故障码---进气温度传感器微型涡轮电路",
