	"0x27AF0706588C": "1000 W",
	"0x27AF0706588D": "区1",
	"0x27AF0706588E": "故障码---ABS/ESP校准编程",
	"0x27AF07065891": "未规定",
	"0x27AF07065893": "仅在操作颗粒滤清器时执行此指令。保存和修改电脑数据，安装操作自动输入电脑。",
	"0x27AF07065897": "仪表组重新配置(NATS 除外)",
	"0x27AF07065899": "电池重连后，仪表盘上的客户应答错误。客户应答是什么？",
	"0x27AF0706589E": "UCH尚未编程。执行UCH编程程序。",
	"0x27AF0706589F": "插入要分配的钥匙。",
	"0x27AF070658A4": "颗粒滤清器替换后",
	"0x27AF070658A5": "使用诊断工具进行颗粒滤清器再生后",
	"0x27AF070658A9": "输入车辆里程（测距）然后“确认”。",
	"0x27AF070658AA": "未存储数据而更换电脑后",
	"0x27AF070658B2": "数据传输完成。",
	"0x27AF070658B3": "出现下列情况时选择【是】：\\n-喷射器已更换，\\n-喷射器代码已输入(“输入喷射器代码”)\\n然后按【确认】",
	"0x27AF070658B8": "该指令用于配置车辆的最大速度。\\n\\n选择一个推荐的MPH（KM/H）值来激活此配置。\\n\\n推荐的速度范围为54 MPH（90 KM/H）至78 MPH（130 KM/H）且是6 MPH（10 KM/H）的倍数。\\n\\n重要提示：仪表板上必须粘贴标签说明已编程的速度。",
	"0x27AF070658B9": "已执行配置。关闭+点火后电源并等待诊断工具上出现丢失的通信信息。如果信息不出现，等待9分钟。",
	"0x27AF070658BD": "ACB：音频接线盒。售后多媒体接线盒\\nCBOX：接线盒。多媒体接线盒安装为标配\\nCDC：光盘换碟机。CD换碟机\\nNAV：导航\\n音频接线盒与CD换碟机安装在相同的输出端。仅CD换碟机或音频接线盒可在任意时间内安装。\\n配置喇叭时，检查是否有前置高音喇叭和后置喇叭。\\n\\n类型1：配备后置喇叭/配备前置高音喇叭\\n类型2：配备后置喇叭/未配备前置高音喇叭\\n类型3：未配备后置喇叭/配备前置高音喇叭\\n类型4：未配备后置喇叭/未配备前置高音喇叭\\n\\nX76配置：\\n配置1：旅行车，标准，右座驾驶\\n配置2：旅行车，标准，左座驾驶\\n配置3：旅行车，短途，右座驾驶\\n配置4：旅行车，短途，左座驾驶\\n配置5：货车，未配备隔板，右座驾驶\\n配置6：货车，未配备隔板，左座驾驶\\n配置7：货车，配备隔板（釉面或面板），右座驾驶\\n配置8：货车，配备隔板（釉面或面板），左座驾驶\\n\\n音响版本：对于已交付的车辆：\\n-2010年9月11号之前：选择配置1（配置1）\\n-2010年9月11号至2011年2月2号之间：卸下乘客侧前置喇叭并记录零件号（喇叭背面）。\\n如果零件号为TUAC零件号，选择配置1（配置1）\\n如果零件号为SOFAITAL零件号，选择配置2（配置2）\\n-D2之后：选择配置2（配置2）\\n\\nTUAC零件号：28 144 0962R\\nSOFAITAL零件号：28 156 7910R \\n\\nX83配置：\\n配置1：货车，未配备隔板，左座驾驶\\n配置2：货车，未配备隔板，右座驾驶\\n配置3：货车，配备隔板（釉面或面板），左座驾驶\\n配置4：货车，配备隔板（釉面或面板），右座驾驶\\n配置5：COMBI或客车，左座驾驶\\n配置6：COMBI或客车，右座驾驶",
	"0x27AF070658BE": "颗粒滤清器更换自适应",
	"0x27AF070658BF": "颗粒滤清器再生自适应",
	"0x27AF070658C3": "编程程序结束",
	"0x27AF070658C5": "该指令增加快怠速转速并伴随振动。当从加热阶段转换到再生阶段时，发动机声音出现变化是正常的。",
	"0x27AF070658D1": "重要：这些参数仅在更换仪表盘时使用。点火打开，发动机停止。这些参数将旧仪表盘上的值传输到新仪表盘上，这些值是：\\n- 机油更换频率：两次机油保养之间的距离间隔\\n- 机油更换前的里程：下次机油保养前所要行驶的距离\\n- 里程表：车辆行驶的总距离，请确保在继续前记录旧仪表盘中的上述值。",
	"0x27AF070658D2": "电控单元数据保存文件不存在。运行电控单元更换或重新编程的备份程序。",
	"0x27AF070658D4": "此为下次机油更换前将行驶的当前里程。",
	"0x27AF070658D5": "此为车辆行驶的总距离。",
	"0x27AF070658D7": "此为两次机油更换之间的距离间隔。",
	"0x27AF070658DC": "等到显示出结果。\\n\\n上升时间等于65 5350毫秒，测试停止，重新开始测试。\\n如果有任一步骤显示出“过慢”或“过快”，参考车辆保养手册解决相应故障。\\n如果所有步骤显示“正常”，表示高压燃油线路正常，无需对系统进行任何操作。",
	"0x27AF070658DF": "故障探测测试检查高压泵效率,确保高压油管中没有泄露。检查高压泵、油轨和喷油器。测试前，\\n- 车辆保持静止，应用驻车制动\\n- 手动变速器：空挡/自动变速器：驻车挡\\n- 发动机怠速， W/O ELEC CONSUM ON (TURN OFF CLIM CNT SYS AND HTD RR SCRN) \\n- CLNT TEMP & FUEL TEMP BTWN LIMS (GREEN IND). NEVER PRFRM OPE ON VEH DURING TEST OR TEST IS INV",
	"0x27AF070658E4": "发动机检测：EDC16C36 \\n- 点火开关开启，发动机停止 \\n- 为期望汽缸（汽缸1飞轮端）选择喷油器代码\\n- 输入新代码（7字符），确定以保存。提示：有效字符为：1至8，A至Z。请勿混淆：“1”和“I”、“L”，“2”和“Z”，“5”和“S”，“6”和“G”，“8”和“B”。电脑编程/重新编程后，输入4个喷油器代码并确认。",
	"0x27AF070658E7": "输入的字符配置错误，查阅车辆相关资料。许可字符为：1、2、3、4、5、6、7、8、A、B、C、 D、E、F、 G、H、I、K、L、 M、N、O、P、R、S、T、U、V、W、X、Y、 Z。",
	"0x27AF070658EA": "发动机检测：EDC16C33/EDC17 \\n- 点火开关开启，发动机停止 \\n- 为期望汽缸（汽缸1飞轮端）选择喷油器代码\\n- 输入新代码（7字符），确定以保存。提示：有效字符为：1至8，A至Z。请勿混淆：“1”和“I”、“L”，“2”和“Z”，“5”和“S”，“6”和“G”，“8”和“B”。电脑编程/重新编程后，输入4个喷油器代码并确认。注意：",
	"0x27AF070658EC": "点火打开，发动机停止。重要：确认配置前，必须先删除所有与广播配对的手机，并在车辆交付时告知用户。",
	"0x27AF070658ED": "点火打开，发动机停止。仅在更换或编程电脑时使用此指令，用来重写先前保存的数据以便自动重新下载到新电脑中。\\n重要：输入数据所需的时间各异。切勿中断程序。",
