	"0x27AF07065C88": "必须在下列条件下编程传感器：\\n1-点火打开且发动机关闭时，向左或向右转动方向盘至少20度\\n2-将方向盘重新定位至中央位置，且车轮朝向正前方（直线行驶）。请勿再触摸方向盘。\\n3-通过按下【开始】激活指令。注意：为了让车轮准确地朝向正前方，必须在前轴调节台架上进行该测试。\\n4-关闭点火开关。\\n5-重新打开点火开关并检查方向盘角度值。\\n6-起动发动机并将方向盘向左转到底锁止，然后向右转到底锁止。\\n7-检查是否无故障。",
	"0x27AF07065C89": "传感器必须在以下条件下进行编程： \\n1- 打开点火，发动机停止。\\n2- 车辆停放在平坦的水平面。\\n3- 使方向盘处于车轮朝向正前方的位置，修正胎压并松开手刹。 \\n4- 车辆上仅留一个在驾驶座上。\\n5- 按下“验证”，激活指令。\\n6- 关闭点火。\\n7- 检查车辆是否无故障。",
	"0x27AF07065C8C": "发动机扭矩参考值",
	"0x27AF07065C8D": "附加信息 2818",
	"0x27AF07065C8E": "必须在以下条件下执行随速无线电音量自动控制控制测试：\\n1- 打开点火，发动机不运行。\\n2- 打开无线电并激活“自动音量控制”功能。\\n3- 通过按“验证”激活指令。\\n4- 检查无线电音量是否增大。重要提示：大概需要30秒来完成指令。",
