	"0x27AF0706758B": "无填充",
	"0x27AF0706758C": "压力调节阀的作动不 OK。\\n压力调节阀的流量无法降至此测试所需的数值。\\n请再次执行测试。",
	"0x27AF0706758D": "输入每一缸的泄漏量 (CM)。",
	"0x27AF0706758E": "检查油轨压力传感器",
	"0x27AF0706758F": "点火开关 ON\\n油轨压力传感器上的塞子未拆开。",
	"0x27AF07067590": "发动机以怠速运转\\n冷却液温度 > 80°C \\n所有实际值均符合各自的指定值范围后才能作动。",
	"0x27AF07067591": "发动机以怠速运转\\n冷却液温度 > 80°C",
	"0x27AF07067592": "将方向盘转向正前\\n冷却液温度 > 60°C \\n将发动机转速提升至约 1500 RPM。",
	"0x27AF07067594": "当作动 '开始' 及 '停止' 按钮时，废气再循环冷却器旁通门的机构必须有明显的移动。",
	"0x27AF07067595": "检查预热塞",
	"0x27AF07067596": "检查EGR冷却器旁通切换阀",
	"0x27AF07067597": "CDI 控制单元的故障记忆中无故障存在。\\n施加驻车制动。\\n手动变速箱车型不可挂入任何档位，\\n自动变速箱车型需选择 P 或 N 档。\\n发动机以怠速运转。",
	"0x27AF07067599": "检查油雾喷嘴关闭阀",
	"0x27AF0706759A": "选择要测试的元件。\\n接通点火开关。",
	"0x27AF0706759B": "当超过极限值 >= 25BAR 至少 3 次时出现一个故障。\\n冷却液温度 > 80°C \\n燃油温度 > 20°C \\n内燃机怠速运转",
	"0x27AF0706759C": "施加驻车制动。\\n内燃机以怠速运转\\n冷却液温度高于 80°C。",
	"0x27AF0706759D": "若要达到氧传感器的工作温度，\\n可提升发动机转速到 1800 RPM 最多 15 分钟。",
	"0x27AF0706759E": "启动内燃机并使其怠速运转。\\n油温必须在 80°C 至 100°C 之间。\\n作动期间的油压必须 >= 1.5BAR。\\n如果油雾喷嘴关闭阀未作动，\\n油压必须 <= 1.5BAR。",
	"0x27AF0706759F": "检查催化转化器上游的O2传感器",
	"0x27AF070675A0": "测试步骤会持续约 30 秒。",
	"0x27AF070675A1": "当最高发动机转速及发动机扭矩在指定范围内时，挂入下一档。 换档 下限 上限 发动机转速 1-2 20 NM 50 NM 2500 2-3 20 NM 60 NM 2700 3-4 30 NM 70 NM 2900 4-5 40 NM 80 NM 2900 5-6 40 NM 100 NM 2900 6-7 40 NM 120 NM 2900",
	"0x27AF070675A5": "测试已中止。\\n内燃机未以怠速运转。\\n在测试期间，内燃机必须以怠速运转。\\n再测试一次",
	"0x27AF070675A6": "检查冷却液泵是否正常操作",
	"0x27AF070675A7": "必须没有关于冷却液泵切换阀的电气故障存在。\\n内燃机怠速运转。\\n加热 OFF。\\n空调必须关闭。\\n所有的电气配件都必须关闭。\\n\\n冷却液温度必须在 10°C 至 30°C 之间或\\n在 50°C 至 55°C 之间也可以。\\n指定油温值为：<= 80°C \\n在室温下执行测试。",
	"0x27AF070675A8": "检查发动机诊断指示灯",
	"0x27AF070675A9": "发动机以怠速运转\\n如果发动机诊断指示灯由于故障码存在而亮起，则无法执行作动。",
	"0x27AF070675AA": "燃油温度 > 20°C \\n开启空调。\\n开启远光灯。\\n开启后窗加热器。\\n内燃机怠速运转。\\n\\n当接到指示时，快速将油门踏板踩到底并立即放开。\\n当超过极限值 >= 250BAR 至少 3 次时出现一个故障。",
	"0x27AF070675AB": "检查不 OK\\n冷却液升温不足检查冷却液泵，必要时加以更换。",
	"0x27AF070675AC": "启动内燃机并使其怠速运转。\\n油温必须在 80°C 至 100°C 之间",
	"0x27AF070675AD": "检查EGR执行器",
	"0x27AF070675AE": "以作动的方式检查发动机诊断指示灯。",
	"0x27AF070675AF": "检查发动机机油泵阀",
	"0x27AF070675B0": "点火开关 ON\\n电池电压必须在 11V 至 15.5V 之间，必要时请连接充电器。\\n内燃机为停止状态",
	"0x27AF070675B1": "学习步骤未完成。",
	"0x27AF070675B2": "凸轮轴霍尔效应传感器的学习值重设",
	"0x27AF070675B3": "增压压力定位器学习",
	"0x27AF070675B4": "内燃机熄火。\\n点火开关 ON\\n内燃机为停止状态\\n油门踏板未操作\\n车辆必须为停止状态\\n有关进气口关闭执行器电机的电气及机械故障必须先处理完成。\\n增压空气温度传感器的温度必须大于 10°C。",
	"0x27AF070675B5": "测试执行中…",
	"0x27AF070675B6": "更换CDI控制单元后的DPF学习",
