	"0x27AF070675C0": "关闭内燃机并将点火开关切换至ON。",
	"0x27AF070675C2": "您是否要因为漏油 (例如涡轮增压器内) 而执行再生，或\\n排气系统中是否有油液？",
	"0x27AF070675C3": "1) 打印出以下的屏幕页面。\\n2) 更换 '柴油微粒过滤器'。\\n3) 再次学习柴油微粒过滤器。",
	"0x27AF070675C4": "等待直到'NOX催化剂后方排气温度'的温度低于400°C。\\n读出ECM的故障记忆并处理故障码。",
