	"0x27AF070675CA": "起动内燃机。 配备自动变速箱的车辆，请将变速箱模式选取为 '手动'。 ECO 起动/停止功能关闭。 车辆必须为停止状态。 按下 '继续' 按钮会开始 '行驶时的柴油微粒过滤器再生' 步骤。 行驶时需有两人。 当按下 '继续' 按钮时，车辆必须在 120 秒内移动。 请按 '继续' 按钮以继续下一步。",
