	"0x27AF070675D9": "内燃机怠速运转。\\n进气温度在 30°C 至 50°C 之间\\n冷却液温度在 80°C 至 100°C 之间\\n燃油温度在 20°C 至 70°C 之间\\n喷射量在 0MG/HUB 至 12MG/HUB 之间",
