	"0x27AF07067632": "检查燃油滤清器入口的燃油压力。 燃油管路阻塞会造成燃油压力上升到超过 8 BAR。 等待约 30 秒直到 '燃油泵状态' 的实际值指示 'OFF' 状态 连接压力测量装置 燃油滤清器入口 燃油管路阻塞会造成燃油压力上升到超过 8 BAR。 当按下 '开始' 按钮后，燃油泵会作动 9 秒的时间。 使用开始按钮开启燃油泵。 使用停止按钮关闭燃油泵。",
	"0x27AF07067633": "检查燃油滤清器入口的燃油压力。",
	"0x27AF07067634": "燃油压力 OK。",
	"0x27AF0706763A": "压力差过高。\\n燃油滤清器脏污。\\n更换燃油滤清器。",
	"0x27AF07067640": "第 3 缸泄漏量",
	"0x27AF07067641": "第 4 缸泄漏量",
	"0x27AF07067643": "排气调节动态测试",
	"0x27AF07067644": "施加驻车制动。 手动变速箱车型不可挂入任何档位， 自动变速箱车型需选择 P 或 N 档。 不可踩下油门踏板。 不可操作制动踏板。 不可操作离合器踏板。(若为手动变速箱) 起动器必须在接下来的 20 秒内作动。 若为按钮起动的车辆，仅需按一下起动按钮 再等待直到自动起动器控制完成即可。(若为自动变速箱) 测试结束时才能放开点火钥匙且 不要将点火开关切回至 'OFF' 位置。",
	"0x27AF07067645": "若为按钮启动的车辆，仅需按一下启动按钮再等待直到自动\\n启动器控制完成即可。(若为自动变速箱)\\n测试结束时才能放开点火钥匙且不要将点火开关切回至 '{0}' \\n位置。(若为手动变速箱)",
	"0x27AF07067646": "检查压力调节阀是否泄漏",
	"0x27AF07067647": "冷却液温度在 -10℃ 至 100℃ 之间 燃油温度在 -10℃ 至 80℃ 之间 电池电压必须在 12 V 至 15.5 V 之间。 连接电池充电器。 必须没有电气的故障存在。 内燃机为停止状态 等待直到低压燃油管路中的压力消退为止。 施加驻车制动。 手动变速箱车型不可挂入任何档位， 自动变速箱车型需选择 P 或 N 档。 拆开燃油回油管路并用管夹夹住。 依图所示连接特殊工具。 点火开关切换至ON。",
	"0x27AF07067648": "启动器作动太久。\\n请再次执行测试。",
	"0x27AF07067649": "测试已成功地完成。检查测试转接器软管内的燃油量。",
	"0x27AF0706764A": "不可关闭点火开关！",
	"0x27AF0706764D": "检查燃油低压回路",
	"0x27AF07067650": "因为未及时挂入目标档位，故学习步骤已中止。",
	"0x27AF07067651": "油轨压力传感器偏移测试",
	"0x27AF07067652": "挂入 'N' 档。",
	"0x27AF07067653": "挂入 'D' 档。",
	"0x27AF07067654": "检查增压压力定位器",
	"0x27AF07067655": "作动时，增压压力定位器的连杆必须有明显的移动。\\n作动时的实际值必须符合指定的数值范围。\\n当按下 'ON' 及 'OFF' 按钮时，可从进气口关闭执行器电机处听到\\n明显的噪音。",
	"0x27AF07067657": "检查不 OK。\\n进一步步骤：检查控制单元及发动机线束以调整测量值。\\n油轨压力传感器的测试信号线。\\n请再次执行测试。\\n测试执行前，必须先短暂拆开一个高压管路以释放系统中的残压。",
	"0x27AF07067658": "测试可能会持续 60 秒。\\n测试期间，转速会增加以测量油轨压力的变动。\\n如果测试的数值与指定值范围 (-20BAR 至 20BAR 之间) 偏差在 30% 之内即表示 OK。",
	"0x27AF07067659": "检查第1缸预热塞",
	"0x27AF0706765A": "检查燃油系统高压泵",
	"0x27AF0706765B": "冷却液温度 > 80°C \\n内燃机怠速运转",
	"0x27AF0706765C": "在接下来的测试中会评估燃油高压回路的压力降。\\n油轨压力会增加到 1600BAR 且内燃机熄火。\\n当内燃机熄火时就会测量燃油高压回路的压力降。\\n如果压力降低太多，则表示系统有泄漏。\\n压力下降应非常缓慢。(>3S)",
	"0x27AF0706765E": "检查燃油高压回路是否泄漏",
	"0x27AF0706765F": "内燃机以怠速运转\\n燃油量必须大于 10 L。\\n冷却液温度 > 80°C \\n燃油温度 > 20°C",
	"0x27AF07067660": "调适值仅在进行过维修工作后才需要重设。\\n虽然重新设定会改变调适值，但不可期望以此方式来改善换档品质。\\n重新设定调适值后必须进行路试。",
	"0x27AF07067661": "您是否真的要重设调适值？",
	"0x27AF07067663": "调适值的重新设定",
	"0x27AF07067664": "重新设定倒档调适值",
	"0x27AF07067665": "第 1 缸泄漏量",
	"0x27AF07067668": "选择档位传感器的学习",
	"0x27AF07067669": "将会引导您完成以下步骤：\\n换档杆位于 'P' 档时的选择档位传感器学习。\\n换档杆位于 'R' 档时的选择档位传感器学习。\\n换档杆位于 'N' 档时的选择档位传感器学习。\\n换档杆位于 'D' 档时的选择档位传感器学习。",
	"0x27AF0706766A": "正在重设控制单元，请稍候…",
	"0x27AF0706766C": "您是否要中止?",
	"0x27AF0706766D": "挂入 'R' 档。",
	"0x27AF0706766E": "第 2 缸泄漏量",
	"0x27AF0706766F": "挂入 'P' 档。",
	"0x27AF07067670": "检查柴油微粒传感器上游的温度传感器",
	"0x27AF07067671": "柴油微粒过滤器上游温度传感器的温度必须比涡轮增压器上游温度传感器\\n的温度再低 0°C 至 50°C。\\n在接下来的测试中，发动机的转速会增加以便\\n测试温度传感器。\\n启动内燃机。",
	"0x27AF07067672": "检查不 OK。",
	"0x27AF07067673": "检查不 OK。 请再次执行测试。 测试执行前，必须先短暂拆开一个高压管路以释放系统中的残压。",
	"0x27AF07067674": "涡轮增压器的上游温度传感器与柴油微粒过滤器的上游温度传感器之间的\\n温度差不可超过 60°C。\\n在接下来的测试中，发动机的转速会增加以便\\n测试温度传感器。\\n启动内燃机。",
