	"0x27AF070676D0": "当冷却液温度到达 92°C 至 100°C 时会自动开始测试步骤。\\n不可踩下油门踏板。\\n测试步骤会持续约 2 分钟。",
	"0x27AF070676D1": "点火开关 ON\\n连接电池充电器\\n车辆为停止状态\\n所有的实际值均符合其指定值范围时才能作动。\\n内燃机及空调用电动风扇可用 10 至 90 % 之间的负荷比例作动。\\n当负荷比例为 10 % 时，内燃机及空调用电动风扇为关闭，当负荷比例\\n为 90 % 时则为最高速运转。",
	"0x27AF070676D2": "中断时的填充压力K2",
	"0x27AF070676D3": "当冷却液温度到达 65°C 至 70°C 时会自动开始测试步骤。\\n不可踩下油门踏板。\\n测试步骤会持续约 10 分钟。",
	"0x27AF070676D4": "动态测试压力调节阀",
	"0x27AF070676D5": "冷却液温度 > 80°C \\n燃油温度 > 20°C \\n内燃机怠速运转",
	"0x27AF070676D6": "检查进气口关闭执行器电机",
	"0x27AF070676D7": "点火开关切换至ON。\\n作动时，进气口关闭执行器电机的连杆必须有明显的移动。\\n作动时的实际值必须符合指定的数值范围。",
	"0x27AF070676DA": "当超过极限值 20 BAR 至少 3 次时出现一个故障。\\n测试期间，转速会增加以测量油轨压力的变动。",
	"0x27AF070676DB": "用综合控制风扇电机检查发动机及 AC 空调",
	"0x27AF070676E4": "任何已存在的电气故障均需先排除。\\n空气滤清器及进气软管需正确安装。",
	"0x27AF070676E5": "在接下来的测试步骤中会检测进气及增压空气系统的故障。 测试步骤会持续约 60 秒。 执行测试前需先删除故障记忆。 必须没有电气的故障存在。 增压空气系统中所有的压力及温度传感器都必须装上。 不可操作制动踏板。 手动变速箱车型不可挂入任何档位， 自动变速箱车型需选择 P 或 N 档。 在排气尾管上正确地安装抽风系统。 所有的电气配件都必须关闭。 室温必须在 15℃ 至 50℃ 之间。 冷却液温度 > 40℃ 内燃机怠速运转。",
