	"0x27AF07067E80": "内燃机及空调用集成控制电机是否在跛行回航模式中？",
	"0x27AF07067E82": "关闭",
	"0x27AF07067E83": "作用",
	"0x27AF07067E86": "检查风扇作动的电源宽度调变信号\\n点火开关ON\\n内燃机为停止状态\\n车辆为停止状态",
	"0x27AF07067E87": "内燃机及空调用的集成控制风扇电机可能不在跛行回航模式中。 作动内燃机及空调用的集成控制风扇电机 冷却液温度<80℃ 连接电池充电器。 电池电压必须介于12.5至14.5之间。 点火开关已开启。 内燃机为停止状态。 车辆为停止状态。 内燃机及空调用的集成控制风扇电机的电气保险丝为OK。 当负荷比例为10%时，内燃机及空调用电动风扇为关闭，当负荷比例为90%时则为最高速运转。",
	"0x27AF07067E88": "闭合回路",
	"0x27AF07067E89": "油轨满",
	"0x27AF07067E90": "内燃机怠速运转\\n冷却液温度介于75°C至105°C之间。\\n所有的电气配件都必须关闭。\\n过滤后的油轨压力实际值与默认值控制在\\n3BAR至12BAR之间。",
	"0x27AF07067E92": "当开始作动后，发动机转速会短暂下降且怠速转速会明显不稳。",
	"0x27AF07067E93": "检查燃油压力及温度传感器",
	"0x27AF07067E96": "凸轮轴定位器",
	"0x27AF07067E97": "施加驻车制动。\\n将自动变速箱车辆的换档杆移到P档或N档。\\n将手排变速箱车辆的换档杆移至空档。\\n测试期间发动机转速必须在2700至3500RPM之间。",
	"0x27AF07067E99": "检查进气凸轮轴电磁线圈",
	"0x27AF07067E9B": "检查不OK。\\n更换'右侧进气'凸轮轴定位器及控制阀。",
	"0x27AF07067E9C": "发动机启动后时间＞60秒\\n发动机转速提升至约3000－3500RPM。",
	"0x27AF07067E9D": "如果出现关于凸轮轴的故障码，控制单元可能会在某些情况下限制凸轮轴的作动。作动凸轮轴会使凸轮轴相关的故障码保存至故障记忆或控制单元中。\\n作动后可能需要删除故障记忆。",
	"0x27AF07067E9E": "检查排气凸轮轴电磁线圈",
	"0x27AF07067E9F": "点火开关已开启。\\n发动机怠速运转\\n冷却液温度>80°C",
	"0x27AF07067EA4": "切勿将点火开关切换至OFF。\\n喷油嘴切换为OFF。\\n踩住制动踏板不放。\\n油轨压力(实际值)应介于18MPA至22MPA之间。",
	"0x27AF07067EA5": "实际值OK",
	"0x27AF07067EA6": "检查燃油高压回路",
	"0x27AF07067EA7": "点火开关ON\\n切勿将点火开关切换至OFF。\\n施加驻车制动。",
	"0x27AF07067EA8": "点火开关ON\\n切勿将点火开关切换至OFF。\\n冷却液温度介于75°C至105°C之间\\n燃油温度介于40°C至80°C之间\\n启动内燃机。\\n内燃机怠速运转\\n关闭所有耗电设备。\\n将充电器连接至电池。\\n油轨压力应介于19MPA至21MPA之间。",
	"0x27AF07067EA9": "油轨压力在3分钟内不得降至10MPA以下。",
	"0x27AF07067EAA": "油轨压力(实际值)过低。",
	"0x27AF07067EAB": "油轨压力(实际值)过高。",
	"0x27AF07067EAD": "检查喷油嘴",
	"0x27AF07067EAE": "检查数量控制阀",
	"0x27AF07067EAF": "燃油低压回路OK。\\n内燃机怠速运转。\\n所有的电气配件都必须关闭。",
	"0x27AF07067EB0": "冷却液温度<75°C \\n内燃机怠速运转。\\n所有的电气配件都必须关闭。\\n切勿用手操作涡轮增压器的控制杆。\\n作动期间，真空装置的连杆必须看得见移动。\\n涡轮增压器控制杆可轻易移动。\\n涡轮增压器控制杆在作动期间应可轻易移动。",
	"0x27AF07067EB1": "检查减速空气切换阀",
	"0x27AF07067EB2": "内燃机怠速运转。\\n节气门上游压力传感器的压力应介于-500HPA至1500HPA之间。\\n冷却液温度<75°C",
	"0x27AF07067EB4": "内燃机为停止状态。\\n点火开关ON。\\n作动发动机机油泵阀\\n开启：电压1V...2V\\n关闭：电压0.1V...0.18V",
	"0x27AF07067EB5": "检查冷却液泵切换阀",
	"0x27AF07067EB6": "点火开关已开启。\\n内燃机为停止状态。\\n作动 '减速空气切换阀'\\n可听见 '减速空气切换阀' 切换。",
	"0x27AF07067EB9": "检查净化切换阀",
	"0x27AF07067EBC": "以作动的方式来检查净化切换阀\\n点火开关ON",
	"0x27AF07067EBE": "内燃机为停止状态\\n点火开关ON\\n作动时元件的电流值介于390MA至495MA之间。",
	"0x27AF07067EBF": "执行净化切换阀的机械性能测试\\n作动OK。\\n内燃机怠速运转",
	"0x27AF07067EC4": "输入燃油压力 (BAR)",
	"0x27AF07067ECC": "增压压力",
	"0x27AF07067ECD": "增压压力定位器的负荷比率应介于87%至100%之间。",
	"0x27AF07067ED2": "电机相电流",
	"0x27AF07067ED5": "故障码---偏移率传感器回路",
	"0x27AF07067ED6": "无法正常执行对正。\\n请再次执行对正。",
	"0x27AF07067ED7": "检测到写入错误。\\n再次执行对正。",
	"0x27AF07067EE0": "执行接合点学习。请保持以下状态并触摸 '开始'： \\n-车辆：停止 \\n-发动机转速：怠速 \\n-选档杆：N 档 \\n-制动踏板：踩下 \\n-油液温度：50 - 100℃ (122 - 212℉)",
	"0x27AF07067EE1": "执行中 执行中，请踩下制动踏板并将选档杆换至 D 档。 D 档完成后，请执行 R 档。 若要停止学习，请将选档杆移至 P 档。",
