	"0x27AF0706B38E": "关闭内燃机。\\n冷却液温度必须大于或等于85 ℃（185 ℉）",
	"0x27AF0706B38F": "测试过程中发动机转速和轨压增加。\\n测试结束时关闭内燃机。\\n当发动机运行时，如果达到一个或多个测试软管的最大容量，请立即停止驱动。\\n进入下一页。\\n如果由于测试管道溢流导致测试过程中关闭了内燃机，那么务必更换受影响汽缸的燃油喷射器。\\n每次更换了燃油喷射器之后，必须对该燃油喷射器进行重新分类（喷射器喷油量调节）。",
