	"0x27AF0706B39E": "通过流量控制阀进行轨压调节。\\n通过压力调节阀进行轨压调节。\\n发动机转速提高时通过压力调节阀进行轨压调节。\\n切换过程中允许轨压出现重大偏差，评估时应忽略此偏差。",
