	"0x27AF0706B3A8": "关闭（不可信）",
	"0x27AF0706B3A9": "开启（不可信）",
	"0x27AF0706B3AB": "运行（转速受限）",
	"0x27AF0706B3AC": "关闭内燃机，\\n打开点火，\\n进气温度在0到50°C之间，\\n冷却液温度在80到100°C之间，\\n燃油温度在20到70°C之间。",
	"0x27AF0706B3AD": "用软管夹或止栓密封“燃油系统高压泵”组件的低压燃油管线。",
	"0x27AF0706B3AE": "怠速运行内燃机，\\n进气温度在0到50°C之间，\\n机油温度大于70°C，\\n燃油温度在20到70°C之间。",
	"0x27AF0706B3AF": "教入程序将持续20到60分钟。\\n每次教入程序开始时，计数器都将重置为0。\\n教入程序结束后关闭内燃机。\\n教入过程中修正次数将逐步增加。",
	"0x27AF0706B3B5": "如果相关实际值低于100%，且无变化，则表示存在故障。\\n提示信息“DTR再次恢复可用”未出现。\\n调整程序出现延迟的原因如下：\\n隧道内行车、车辆剧烈加速、车辆转弯和少量障碍物绕行。",
	"0x27AF0706B3B9": "当实际值达到100%时，传感器校准已全部完成。\\n信息显示器上会显示“DTR再次恢复可用”信息。",
	"0x27AF0706B3BA": "手动校准智能巡航控制系统传感器时必须拆下保险杠。",
	"0x27AF0706B3BC": "内燃机怠速运行。\\n务必关闭所有用电设备。",
	"0x27AF0706B3BD": "未按下按键",
	"0x27AF0706B3CD": "更换电池后需再次确认电池已更换。\\n确认电池已更换后，将充电量设为0,00AH。",
	"0x27AF0706B3D8": "右前轮胎胎压至少改变0.3巴（4.35 PSI）。\\n如果胎压传感器ID显示正确，表示功能检查已成功。\\n打开TPMS测试单元（转发器），\\n选择433 MHZ频率。使用测试单元读取右前胎压传感器数值。",
	"0x27AF0706B3D9": "右后轮胎胎压至少改变0.3巴（4.35 PSI）。\\n如果胎压传感器ID显示正确，表示功能检查已成功。\\n打开TPMS测试单元（转发器），\\n选择433 MHZ频率。使用测试单元读取右后胎压传感器数值。",
	"0x27AF0706B3DB": "左前轮胎胎压至少改变0.3巴（4.35 PSI）。\\n如果胎压传感器ID显示正确，表示功能检查已成功。\\n打开TPMS测试单元（转发器），\\n选择433 MHZ频率。使用测试单元读取左前胎压传感器数值。",
