	"0x27AF0706BC39": "故障码---NOX超标-试剂消耗",
	"0x27AF0706BC3B": "存在爆炸、中毒和受伤的风险。\\n摄入时，燃油高度易燃且有毒。\\n燃油会造成皮肤损伤。\\n燃油蒸汽具有爆炸性、肉眼不可见且沿地板水平扩散。\\n吸入后，引起中毒以及头晕现象，且具有麻醉效果。\\n安全须知/注意事项\\n穿戴适当的防护服。\\n遵守特定国家的安全条例和规则。\\n严禁点火、火花、明火或吸烟。\\n确保工作场所通风良好。\\n切勿在维修区域之外排放或填充燃油。\\n将排出的燃油存放在合适的可锁定容器中。\\n立即清理溅出的燃油。\\n急救措施\\n用水和肥皂清洁燃油浸泡的皮肤。\\n尽快更换燃油浸湿的衣服。\\n如果燃油接触到眼睛，\\n立即用水冲洗眼睛，必要时请就医。",
	"0x27AF0706BC3C": "[左喇叭按钮/右喇叭按钮]按钮",
