	"0x27AF0706BC45": "传感器转子自适应自学习",
	"0x27AF0706BC46": "减速断油状态",
	"0x27AF0706BC47": "故障码---停止/起动系统",
	"0x27AF0706BC48": "啮合1挡。\\n对于机械式自动变速箱，请选择手动换挡模式。\\n加速至20 KM/H（13 MPH），然后释放加速踏板以便减速（在断油状态中）。",
	"0x27AF0706BC4A": "更换传感器转子。\\n更换曲轴霍尔传感器。\\n更换ECM之后未传输自适应值。",
	"0x27AF0706BC4B": "复位右侧日间行车灯转向灯的工作时间计数器",
	"0x27AF0706BC4D": "复位右前灯风扇电机1的工作时间计数器",
	"0x27AF0706BC50": "检查EGR",
	"0x27AF0706BC51": "首先需清除所有存在的电气故障。\\n空气滤清器和进气软管被正确安装。\\n打开点火开关并停止发动机。\\n测试过程必须在一个会话中执行到结束。\\n所列出的修正值在后续测试过程中重置。\\n此过程中诊断工具必须保持连接。",
	"0x27AF0706BC52": "EGR阀阻塞",
	"0x27AF0706BC53": "检查电源",
	"0x27AF0706BC55": "[声控系统打开按钮]按钮",
	"0x27AF0706BC56": "严禁存在电气故障。\\n真空系统处于密封状态。\\n在此过程中诊断单元严禁与诊断插座断开。\\n开始测试之前清除错误内存。\\n将抽风系统正确连接至排气尾管。\\n环境温度范围必须为15 ℃至50 ℃。\\n手动变速箱：请勿啮合任何挡位。\\n自动变速箱：选择P或N挡。\\n必须关闭所有电气附件。\\n请勿操作制动踏板。\\n发动机怠速运行。\\n必须安装充气系统中的所有压力和温度传感器。\\n冷却液温度：40 ℃以上",
	"0x27AF0706BC57": "EGR比率采集",
	"0x27AF0706BC58": "更换空气滤清器。在整个过程中，诊断装置不得从诊断插座上断开。\\n更换空气滤清器后，按【继续】进行下一个步骤。",
	"0x27AF0706BC5A": "行驶里程超过30,000公里的车辆是否已安装空气滤清器？",
	"0x27AF0706BC5C": "废气再循环自适应测试台1成功",
	"0x27AF0706BC5D": "自适应状态",
	"0x27AF0706BC5E": "为了修正路径、减少损耗以及通道顺畅，请检查空气滤清器进气管。\\n检查空气滤清器和涡轮增压器之间是否干净，以防止泄露并修正路径。\\n检查空气滤清器是否正确安装。\\n检查热膜式空气质量流量传感器和相关组件以保证气密性密封、正确安装及防止机械损伤。\\n检查曲轴箱通风系统确保密封性。\\n必要时修复故障",
