	"0x27AF0706D884": "这将测试固定时间内柴油排气处理液流率。\\n初始条件\\n1. 后处理柴油排气处理液系统完整且所有机械接头已经重新组装。\\n2.发动机停止\\n3. 有效后处理故障码不存在\\n4. 柴油排气处理液（DEF）罐液体足够完成测试\\n5. 柴油排气处理液（DEF）罐处于工作温度下。温度应高于0 ℃（32 ℉）且低于52 ℃（125.6 ℉）",
	"0x27AF0706D885": "发动机停止运行的情况下关闭、打开电动升降机泵，以此测试查验运行是否正常。",
	"0x27AF0706D886": "初始状态：\\n1.  发动机怠速运行。\\n2.  车辆停止行驶。\\n\\n再生过程中，废气温度可能会高达800℃（1472℉），废气系统表面温度可能会超过700℃（1291℉），预计发动机转速可能达到1000转到1500转。请仔细阅读说明书，严格遵照指示操作，避免发生火灾、财产损失、烧伤或其他严重人身伤害。\\n\\n静态再生的准备条件：\\n1.  将车辆停放在合适位置。\\n停放表面在高温情况下不容易燃烧或融化（如干净的混泥土或砾石表面，不能停放在玻璃或沥青表面）；\\n- 远离易燃、易融或易爆物品；\\n- 排气口附近两英尺之内不能有任何物品（如汽油、木材、纸、塑料、织物、压缩气罐和液压管路），\\n- 且不能有易燃、易爆或易导致火灾的气体或蒸汽（如液化石油气、石油蒸汽、氧气、一氧化二氮等）；\\n- 切勿让人靠近排气口；\\n- 该位置还必须有利于观察再生过程中排气区域的状况。\\n2.  请将卡车妥善停放，\\n- 拉起手刹，\\n- 挂入停车挡或空挡，\\n- 将车轮垫楔塞在至少一个轮胎的前后面。\\n3. 设定好安全排气区域，\\n- 如旁观者可能会进入此区域，架设栅栏，确保再生过程中人员距离排气口至少五英尺以上。\\n- 如在室内，接入额定温度至少800℃（1472℉）以上的排气管，\\n- 将灭火器准放在附近。\\n4.  检查废气系统表面，\\n- 确认废气系统表面或附近无任何异物（如工具、抹布、油脂、杂物等）。\\n5.  再生过程中做好准备，发动机转速会发生变化。\\n- 勿操作任何动力输出设置，启动再生前，务必断开所有动力输出设置的电源；\\n- 与发动机舱保持一定距离，\\n\\n确保再生过程中车辆和周围区域一直处于监控状况下，如有任何不安全状况发生，立即停止再生。\\n再生一结束，废气和排气装置表面温度将持续升高3到5分钟。\\n\\n上述所有条件是否均已满足？",
	"0x27AF0706D888": "发动机控制模块检测到故障状况，检查是否存在活跃故障。\\n显示以下弹出信息：\\n警告：务必让发动机和后处理系统冷却下来。",
	"0x27AF0706D889": "后处理柴油颗粒滤清器再生无法启动，因为驻车制动器尚未拉起。先拉起驻车制动器，然后重启再生。",
	"0x27AF0706D88C": "后处理柴油颗粒滤清器再生无法启动，因为动力输出装置（PTO）或遥控动力输出装置已启动。先停止动力输出和遥控动力输出装置，然后重启再生。",
	"0x27AF0706D88D": "后处理柴油颗粒滤清器再生无法启动，因为OEM传感器压力或温度超出范围。先检查OEM传感器数值，确保均处于正常工作范围，然后重启再生。",
	"0x27AF0706D88E": "后处理柴油颗粒滤清器再生无法启动，因为加速踏板或节气门位置大于零。先确保加速踏板或节气门已松开，然后重启再生。",
	"0x27AF0706D88F": "后处理柴油颗粒滤清器再生无法启动，因为变速器已挂挡或数据链指令阻止再生。\\n先将变速器挂入驻车挡或空挡，然后重启\\n再生。",
