	"0x27AF0706D970": "后处理柴油颗粒滤清器再生无法启动，因为废气再循环系统或涡轮增压器有问题。先解决所有故障码，然后重启再生。",
	"0x27AF0706D971": "后处理柴油颗粒滤清器再生无法启动，因为当前发动机运行状态不允许静态再生。先确认发动机状态，解决所有问题，然后重启再生。",
	"0x27AF0706D972": "后处理柴油颗粒滤清器再生无法启动，因为车辆正在行驶或车速传感器产生故障码。先停止车辆行驶，确保车速传感器无故障码，然后重启再生。",
	"0x27AF0706D973": "后处理柴油颗粒滤清器再生无法启动，因为数据链指令阻止再生。先检查数据链上所有设备，解决所有故障码，然后重启再生。",
	"0x27AF0706D974": "后处理柴油颗粒滤清器再生无法启动，因为离合器或保养刹车已踩下。先松开离合器和保养刹车，然后重启再生。",
	"0x27AF0706D976": "后处理柴油颗粒滤清器再生无法启动，因为发动机减速保护已启动。先解决所有故障码，然后重启再生。",
	"0x27AF0706D977": "后处理柴油颗粒滤清器再生无法启动，因为发动机冷却液温度过低。继续保持发动机运行，待冷却液温度升高后重启再生。",
	"0x27AF0706D97A": "该特色功能指保养功能可访问瞬时油耗跟踪数据以及\\n40小时后每过一小时的油耗跟踪数据。\\n同时还会显示发动机全生命周期内的油耗率。",
	"0x27AF0706D97B": "该特点功能指燃油或发动机定时组件更换后可重置自适应学习表格数值。",
	"0x27AF0706D97C": "发动机序列号",
	"0x27AF0706D97D": "故障码---曲轴箱压力",
	"0x27AF0706D97E": "该功能允许技术人员安装和复位后处理系统。\\n后处理维修允许技术人员安装/复位后处理维修部件。例如一个新的或干净的柴油氧化催化剂或柴油微粒过滤器。\\n一旦ECM认为柴油氧化催化剂表面堵塞，后处理计量会被禁用。更换表面堵塞的柴油氧化催化剂之后，技术人员可将柴油氧化催化剂表面堵塞值复位至干净以便启用计量并重新启动主动再生。为了防止误用该功能，只有在最严重的故障时才能使用复位。\\n条件取决于正在复位的微粒后处理部件。",
