	"0x27AF070717C3": "下列情况发生时,检测到 故障码...\\n-与来自质量型空气流量传感器,凸轮轴位置传感器和 IACV-AAC 阀的信号相比,输入 ECM 的电压不正确。",
	"0x27AF070717C4": "下列情况发生时,检测到 故障码...\\n-在规定驾驶状态下,EVAP碳罐口控制阀持续打开。 检查项目(可能的原因)\\n-EVAP碳罐口控制阀\\n-EVAP 控制系统",
	"0x27AF070717C6": "下列情况发生时,检测到 故障码...\\n-即使 EVAP 碳罐净化量控制阀完全关闭,在规定驾驶状态下检测到碳罐净化流量 检查项目(可能的原因)",
	"0x27AF070717C7": "下列情况发生时,检测到 故障码...\\n-通过 EVAP 碳罐口控制阀向 ECM 输入不正常电压信号。 检查项目(可能的原因)\\n-线束或接头(EVAP碳罐口",
	"0x27AF070717C8": "下列情况发生时,检测到 故障码...\\n-来自传感器的最低电压没有达到规定电压 检查项目(可能的原因)\\n-线束或接头(传感器电路 开路或短路。)",
	"0x27AF070717CC": "下列情况发生时,检测到 故障码...\\n-来自传感器的电压信号循环大于规定时间 检查项目(可能的原因)\\n-线束或接头(传感器电路",
	"0x27AF070717CF": "下列情况发生时,检测到 故障码...\\n-来自传感器的电压总是 0.3V 检查项目(可能的原因)\\n-线束或接头(传感器电路 开路或短路。)\\n-前加热型氧",
	"0x27AF070717D0": "下列情况发生时,检测到 故障码...\\n-TCM 试图操作电磁阀时,检测到不正确的电压下降 检查项目(可能的原因)\\n-线束或接头(电磁阀电路开路或短路。)",
	"0x27AF070717D1": "下列情况发生时,检测到 故障码...\\n-TCM 试图操作电磁阀时,检测到不正确的电压下降 检查项目(可能的原因)\\n-线束或接头(电磁阀电路开路或短路。)",
	"0x27AF070717D2": "下列情况发生时,检测到 故障码...\\n-TCM 试图操作电磁阀时,检测到不正确的电压下降 检查项目(可能的原因)\\n-线束或接头(电磁阀电路开路或短路。)",
	"0x27AF070717D3": "下列情况发生时,检测到 故障码...\\n-即使发动机已经运行了很长时间,发动机冷却液温度没有到达规定温度 。",
	"0x27AF070717D4": "在下列情况,检测到 故障码... TCM 从传感器上收到过高或过低的电压。",
	"0x27AF070717D5": "下列情况发生时,检测到 故障码...\\n-MAP/BARO 开关电磁阀通过 ECM 收到电压,但没有向阀提供电压 检查项目(可能的原因)\\n-线束或接头 (MAP/BARO 开关电磁阀",
	"0x27AF070717D6": "下列情况发生时,检测到 故障码...\\n-TCM 试图操作电磁阀时,检测到不正确的电压下降 检查项目(可能的原因)\\n-线束或接头(电磁阀电路开路或短路。)",
	"0x27AF070717D7": "在下列情况,检测到 故障码... TCM 从传感器上收到过高或过低的电压。",
	"0x27AF070717D9": "下列情况发生时,检测到 故障码...\\n-当发动机以规定发动机转速运行时,进气门正时控制位置传感器没有向 ECM 发出正确的脉冲信号。 检查项目(可能的原因)",
	"0x27AF070717DA": "下列情况发生时,检测到 故障码...\\n-当发动机以规定发动机转速运行时,进气门正时控制位置传感器没有向 ECM 发出正确的脉冲信号。 检查项目(可能的原因)",
	"0x27AF070717DE": "下列情况发生时,检测到 故障码...\\n-来自 燃油泵控制模块 的不正确电压信号提供给燃油泵和降压电阻器之间的某个点。",
	"0x27AF070717DF": "无自诊断说明 该车可能是新车型或规格不同",
	"0x27AF070717E1": "下列情况发生时,检测到 故障码...\\n-ECM 检测到飞轮或驱动盘(信号盘)齿(COG)破碎 检查项目(可能的原因)\\n-线束或接头\\n-曲轴位置传感器(OBD 或 POS)",
	"0x27AF070717E3": "下列情况发生时,检测到 故障码...\\n-从传感器检测到发送给 ECM 的异常高或低电压。发送给 ECM。\\n-在轻负载或重负载行驶情况下,向 ECM 发送高压或低压。",
	"0x27AF070717E5": "如果显示 故障码 P1130 和 P1165 首先执行 故障码 P1165 下列情况发生时,检测到 故障码...\\n-通过旋涡控制阀电磁阀 ECM 发送不正确的电压信号\\n-向或没有向旋涡控制阀发送真空信号",
	"0x27AF070717E7": "下列情况发生时,检测到 故障码...\\n-即使在启动发动机一段时间后,从传感器发送给 ECM 的电压仍然不正常\\n-发动机冷却液温度不适合闭环",
	"0x27AF070717E8": "下列情况发生时,检测到 故障码...\\n-即使电子电路正常,A/T 也不能换至 1 档位置。 检查项目(可能的原因)\\n-换档电磁阀 A\\n-换档电磁阀 B\\n-每个离合器",
	"0x27AF070717E9": "下列情况发生时,检测到 故障码...\\n-即使电子电路正常,A/T 也不能换至 2 档位置。 检查项目(可能的原因)\\n-换档电磁阀 B\\n-每个离合器\\n-液压控制",
	"0x27AF070717EA": "在下列情况,检测到 故障码... TCM 并没有从开关收到正确的电压信号(根据档位)。",
	"0x27AF070717EB": "在下列情况,检测到 故障码... TCM 从传感器上收到过高或过低的电压。",
	"0x27AF070717EC": "下列情况发生时,检测到 故障码... 检查项目(可能的原因)\\n-变矩器离合器电磁阀\\n-每个离合器",
	"0x27AF070717ED": "下列情况发生时,检测到 故障码...\\n-TCM 试图操作电磁阀时,检测到不正确的电压下降 检查项目(可能的原因)\\n-线束或接头(电磁阀电路开路或短路。)",
	"0x27AF070717EE": "下列情况发生时,检测到 故障码...\\n-即使电子电路正常,A/T 也不能换至 3 档位置。 检查项目(可能的原因)\\n-换档电磁阀 A\\n-每个离合器\\n-液压控制",
	"0x27AF070717EF": "下列情况发生时,检测到 故障码...\\n-即使电子电路正常,A/T 也不能换至 4 档位置。 检查项目(可能的原因)\\n-换档电磁阀 A\\n-换档电磁阀 B\\n-超越离合器电磁阀",
	"0x27AF070717F0": "下列情况发生时,检测到 故障码...\\n-在节气门打开的情况下,从关闭的节气门位置开关向 ECM 发送蓄电池电压 检查项目(可能的原因)\\n-线束或接头(关闭节气门",
	"0x27AF070717F2": "下列情况发生时,检测到 故障码...\\n-从传感器检测到发送给 ECM 的异常高或低电压。 发送给 ECM。 检查项目(可能的原因)\\n-线束或接头(传感器电路开路或短路。)\\n-发动机冷却液温度",
	"0x27AF070717F4": "下列情况发生时,检测到 故障码...\\n-即使发动机冷却液温度低或高,检测到从 EGR 温度传感器发送给 ECM 的极低或极高电压。 检查项目(可能的原因)",
	"0x27AF070717F8": "下列情况发生时,检测到 故障码...\\n-检测到从传感器发送给 ECM 的异常高或低电压。\\n-与来自发动机冷却液的电压信号相比,从传感器向 ECM 输入合理的不正确电压",
	"0x27AF070717F9": "下列情况发生时,检测到 故障码...\\n-从传感器向 ECM 发送极低或极高电压。\\n-与来自发动机冷却液温度传感器的电压信号相比,ECM 输入合理的不正确电压",
	"0x27AF070717FD": "下列情况发生时,检测到 故障码...\\n-来自传感器的最低电压没有达到规定电压 检查项目(可能的原因)\\n-线束或接头(传感器电路 开路或短路。)",
	"0x27AF070717FE": "如果 故障码 P0510 与 P0120 一起显示 首先执行 故障码 P0510 的 故障诊断 下列情况发生时,检测到 故障码...\\n-从传感器向 ECM 发送极高或极低的电压\\n-高压或低压",
	"0x27AF070717FF": "检查项目(可能的原因)\\n-向 ECM 输入不合理的不正确电压与来自质量型空气流量传感器凸轮轴位置传感器和IACV-AAC 阀的信号相比 检查项目(可能的原因)",
