	"0x27AF07076204": "在电机字段激活时,如果显示下列内容,则正常。 FORW:换档杆 D, 2, 1 STOP:换档杆 P, N. BACK:换档杆 R.\\n-拉起驻车制动。\\n-启动发动机时执行。\\n-不要踩在加速踏板上。",
	"0x27AF07076205": "通过踩下加速踏板使得发动机转速大于 1000 RPM 时,如果发电机电压大于 8V ,则正常。\\n-保持档位在 P 或 N。\\n-为了安全起见,保持汽车静止。\\n-保持发动机启动。",
