	"0x27AF0707B1D0": "在整个过程中踩放制动踏板（直至排气螺钉关闭）。\\n- 打开左前车轮排气螺钉。\\n- 按下'RUN'（运行）按钮激活第2排气阶段，并等待电磁阀 和泵电机不再工作。",
	"0x27AF0707B1D1": "在整个过程中踩放制动踏板（直至排气螺钉关闭）。\\n- 打开右前车轮排气螺钉。\\n- 按下'RUN'（运行）按钮激活第3排气阶段，并等待电磁阀 和泵电机不再工作。",
	"0x27AF0707B1D2": "- 确认制动回路密封。\\n- 踩下制动踏板几次，\\n- 将制动液储液罐加满，\\n- 安装排气设备，加满储液罐，并将压力设置为 2 和 2.5 BAR 之间，\\n- 给回路加压，并使得汽车处于涉及左后车轮的排气阶段 1。",
	"0x27AF0707B1D3": "在整个过程中踩放制动踏板（直至排气螺丝关闭）。\\n- 打开左后车轮排气螺丝。\\n- 按下'RUN'（运行）按钮激活第1排气阶段，并等待电磁阀 和泵电机激活阶段结束。",
	"0x27AF0707B1D4": "踩放制动踏板，直至排气螺丝不再冒出气泡，并关闭排气螺丝。 调节储液罐中的制动液位，并进行道路测试（强迫 ABS 调整）。 在 2 次排气操作之间务必等待 5 分钟，使得电磁阀冷却。",
	"0x27AF0707B1D6": "在整个过程中踩放制动踏板（直至排气螺丝关闭）。\\n- 打开右后车轮排气螺丝。\\n- 按下'RUN'（运行）按钮激活第4排气阶段，并等待电磁阀 和泵电机不再工作。",
	"0x27AF0707B1D7": "踩放制动踏板，直至排气螺丝不再冒出气泡，并关闭排气螺丝。 按下'NEXT'（下一步）按钮继续步骤。",
	"0x27AF0707B1E2": "休眠状态",
	"0x27AF0707B1E3": "燃油盖打开",
	"0x27AF0707B1E8": "选择要检查的车轮，然后确认。",
	"0x27AF0707B1E9": "顶起要检查的车轮。在轮胎和车身之间留下记号。 选择转动方向并将轮胎恰好转动一周， 中途不要改变转动方向然后验证。 （如果在完成转动时超出记号，则重复整个步骤。）",
	"0x27AF0707B1ED": "该命令仅在制动踏板行程变长的情况下按照规则使用 （在操作制动系统和执行传统回路排气后）。 该命令包括4个阶段，可以给4个车轮放气。",
	"0x27AF0707B1EE": "如果计数器上的结果大于 48，则转动超过一周。重复步骤。 如果计数器上的结果小于47，则目标有故障。 如果计数器上的结果是47， 则将车轮上的记号移动 1CM并重复步骤。 如果第2次结果小于48，则目标有故障。",
