	"0x27AF0707B229": "从下列清单选择操作项目。",
	"0x27AF0707B22A": "1. 安全卡保管相关事项 如果将有关防盗锁止系统的信息泄漏或外流出去，会对驾驶NISSAN汽车的客户以及整个NISSAN集团造成极大的威胁。这样的信息泄漏可能会造成非法使用或发生窃盗等情况，并会造成重大的损失。请遵守安全卡的保管存放方法，并由管理人员严格保管。 2. 从客户处取得所有的钥匙。 3. 当进行'初始化ECU'时，切勿在防盗锁止系统天线的周围使用会发射强烈电磁波的装置，例如移动电话、无线电话、无线电收发器等。 4. 注册操作执行完毕后，务必对所有已注册的钥匙执行操作检查。 5. 切勿打印防盗锁止系统的信息。 切勿打印任何有关防盗锁止系统的信息，以避免信息泄漏。 6. 为避免BCM进入CAN通信睡眠模式，在操作期间请开启危险警告灯开关。",
