	"0x27AF0707C66C": "按一下按钮式点火开关 检查按钮式点火开关上的指示灯是否闪烁。",
	"0x27AF0707C66D": "在 5 秒内将智能钥匙靠在按钮式点火开关上。检查组合仪表中的蜂鸣器是否鸣响二次。 注意：将智能钥匙上的徽标靠在点火开关的中央。",
