	"0x27AF0707C675": "更换 ECM (旧零件)",
	"0x27AF0707C677": "更换或安装操作进行后",
	"0x27AF0707C678": "注册钥匙",
	"0x27AF0707C679": "将车辆设定为以下状态，然后触摸 '下一步'。 - 点火开关或电源开关：OFF - 危险警告灯开关：ON (避免 BCM 进入 CAN 通信的睡眠模式) - P 档 (A/T) 或空档 (M/T) - 蓄电池电压：12.5 V 以上 - 转向：不在完全锁住位置",
	"0x27AF0707C67A": "更换 BCM (新零件)",
	"0x27AF0707C67B": "更换转向锁单元 (旧零件)",
	"0x27AF0707C67C": "请按照以下程序进行操作。",
	"0x27AF0707C67D": "触摸 '下一步'。钥匙开关闪烁 5 秒。在钥匙开关闪烁时将 I-KEY 靠在钥匙开关上。当车辆识别出 I-KEY 时，组合仪表中的蜂鸣器会鸣响两声。 注意：天线位于 I-KEY 的上侧 (徽标侧)。将 I-KEY 上的徽标靠在钥匙开关的中央。 当准备完成时请触摸 '下一步'。",
