	"0x27C0C1D2E146": "打开点火。\\n模式1：左后转向信号灯\\n模式2：左驻车灯\\n模式3：左尾灯和驻车灯\\n模式4：点亮\\n模式5：熄灭",
	"0x27C0C1D2E147": "打开点火。\\n模式1：右前驻车灯\\n模式2：右近光灯\\n模式3：右远光灯\\n模式4：右前转向信号灯\\n模式5：右前示廓灯\\模式6：激活全部驱动。\\n模式7：关闭全部驱动。",
	"0x27C0C1D2E148": "插入点火钥匙并保留在0位置。\\n打开端子15R。\\n\\n模式1：线路15继电器\\n模式2：电路15R1继电器\\n模式3：电路15R2动力输出继电器\\n模式4：后车窗雨刮器继电器\\n模式5：关闭",
	"0x27C0C1D2E149": "电路15R关闭",
	"0x27C0C1D2E14A": "外部灯开关位于“自动”位置。\\n激活DEMO模式后，连接电池充电器。\\n如果超出显示的实际值，DEMO模式将自动终止。",
	"0x27C0C1D2E14B": "打开端子15R。\\n模式1：挡风玻璃雨刮器打开/关闭继电器\\n模式2：雨刮器转速1/2继电器\\n模式3：电路15继电器\\n模式4：喇叭继电器\\n模式5：关闭",
	"0x27C0C1D2E14C": "点火打开\\n内燃机未运转。",
