	"0x27C0C1D2E14F": "自动空调和运行单元的开关和控制照明灯",
	"0x27C0C1D2E240": "内燃机正在怠速。\\n冷却液液位正常。",
	"0x27C0C1D2E241": "踩住制动踏板。\\n在测试期间完全踩下加速踏板。\\n按下起动机直到滚动条达到终点。",
