	"0x27C0C1D2E31E": "此功能使发动机控制模块学习IACV-AACV位置以保持发动机以正常转数运转。在更换节气门体或发动机控制模块后,或当怠速点火正时在规定范围之外时，必须采用这种学习模式。执行此功能时必须符合以下条件。若有任一条件不符，调整过程都将无法完成。\\n1.电池电压:>=12.00V(怠速).\\n2.发动机冷却温度:70-100摄氏度。\\n3.空档/停车档:开启。\\n4.电力负荷开关:关闭。(空调，车头灯，后除霜器)\\n5.安有日间行车灯的车辆,请将灯开关调至1,只保留小灯打开。\\n6.发动机电子扇:关闭。\\n7.方向盘:中间位置(一直向前).\\n8.车速:停止。\\n9.空调信号:关闭。\\n11.加热器风扇开关:关闭。\\n12.选择'开始'按钮，提示'请等待5分钟……'\\n\ta) 自动变速箱：踩住刹车，挂倒挡，感觉发动机怠速平稳后即可。\\n\tb) 手动变速箱：拆开空气滤清器，用手堵住进气口，将怠速降到1000rpm以下，10秒左右即可学习成功。注意，堵住进气口时，不可以导致发动机熄火。\\n\\n注意：\\n1. 车型不同，操作菜单有些差别。\\n2. 挂倒挡时发动机可能会熄火，这是正常现象。退出软件之后，重新启动发动机怠速即会正常。\\n3. 水温在80摄氏度以下效果会更好，如果水温过高，请用自来水浇水箱冷却。",
