	"0x27C1C150E241": "点火开关打开,发动机停止",
	"0x27C1C150E243": "此功能允许清除自学习控制值.\\n不正当使用此功能可能导致自学习完成时驾驶性能变坏.\\n按维修手册指导操作.",
	"0x27C1C150E246": "此功能允许发动机控制模块学习怠速空气控制阀的位置以保持发动机的正常怠速.\\n\\n 凡更换怠速空气控制阀,节气门体,发动机模块或怠速或点火正时超过范围时,必须进行此功能. \\n\\n详见维修手册",
	"0x27C1C150E249": "在下列条件下启动，并进行可变正时控制学习.\\n-发动机充分暖机\\n-档位在'P'或'N'文件\\n-发动机速度保持在3000 转/分。",
	"0x27C1C150E24A": "仅在更换WEL执行器局部装配时使用此项。\\n请确认点火开启且发动机已停止。\\n按'开始'键",
	"0x27C1C150E24B": "点火开关打开,发动机停止",
	"0x27C1C150E255": "(TBD) MT描述",
	"0x27C1C150E35A": "按'开始'键并在以下条件中控制怠速点火正时。\\n-发动机已变热。\\n-负载(空调，灯等)已关闭。",
	"0x27C1C150E368": "怠速时按[开始]键将停止燃油泵.发动机停转后再启动几次.",
	"0x27C1C150E37C": "用带有压力表的手动泵从维修口向燃油蒸发排放系统供压.\\n切勿使用压缩空气或高压泵!\\n勿起动发动机.\\n按[开始]键。",
	"0x27C1C150E840": "在下列条件下按【开始】键并设置目标怠速。\\n发动机已预热。\\n负荷（空调、车灯等）已关闭。\\n\\n注意：通用保养程序中通常不需要此功能",
	"0x27C1C150E841": "按'开始'键并在以下条件中控制怠速点火正时。\\n-发动机已变热。\\n-负载(空调，灯等)已关闭。\\n\\n注意:一般维修过程通常不需要此功能。",
	"0x27C1C150E844": "按'开始'键并在以下条件中调整怠速点火正时。\\n发动机已变热。\\n负载(空调，灯等)已关闭。\\n\\n注意:一般维修过程通常不需要此功能。",
	"0x27C1C150E846": "在发动机怠速下设定一氧化碳值",
	"0x27C1C150E847": "按'开始'键并在以下条件中设置目标怠速。\\n发动机已变热。\\n负载(空调，灯等)已关闭。\\n\\n注意:一般维修过程通常不需要此功能。",
	"0x27C1C150E850": "此功能允许改变ECM估算的混合气比率.\\n此功能不正确操作可能导致驾驶性变坏或增加油耗.\\n按维修手册指导操作.",
	"0x27C1C150E8C4": "请确认点火开关开启且发动机已停。在此过程中保持这些条件。\\n\\n按'开始'键",
