	"0x27CCC050E244": "在以下步骤中调整转向角。\\n\\n-启动发动机。\\n-调整方向盘至正前位置。\\n将方向盘往右转直到它停止。\\n调整方向盘返回至正前位置。\\n转向角应该在0±10°范围内，按开始键。",
	"0x27CCC051E244": "结束\\n\\n关闭点火开关并保持15秒\\n15秒后在数据监视器上监视转向角。\\n检查方向盘是否在正前位置0±10°范围内。\\n并在转动方向盘时检查转向角。",
	"0x27CCC053E244": "转向角调整",
	"0x27CCC053E345": "特殊功能",
	"0x27CCC056E244": "按返回键\\n\\n再次检查转向角调整",
	"0x27CDC152E240": "马达启动时如果有下列显示，则为正常。\\n前进: 换档杆D,2,1\\n停车: 换档杆P,N。\\n倒车: 换档杆R。\\n-打开停车制动。\\n-启动发动机时开始进行。\\n-不要踩油门踏板。\\n-使四轮驱动开关保持关闭。",
	"0x27CDC152E243": "踩油门后发动机转速大于1000转/分时，如果发电机电压高于8v则为正常.\\n\\n-使档位保持在P或N位.\\n-为安全起见，要使车辆保持停车状态.\\n-使发动机处于启动状态。 \\n-使四轮驱动开关处于关闭状态。",
	"0x27CDC152E244": "马达启动时的转数大于1转/分则为正常.\\n\\n-保持档位处于P或N档.\\n-使发动机保持启动状态.\\n-不要踩油门. \\n-使4WD开关处于关闭状态",
	"0x27CDC152E246": "当继电器启动时，如果从杂物箱附近能听到继电器操作声，则为正常。\\n-为安全起见，在操作过程中，车辆要保持停车状态。\\n-使四轮驱动开关保持关闭。",
	"0x27CDC152E247": "当后车轮转动及离合器启动时，如果马达转数大于1转/分，则离合器板为正常\\n-保持在停车档或空档。\\n-为了安全请将车辆停止。\\n-使四轮驱动开关保持关闭。",
