	"0x27FF3E2D4845": "1、在更换新的ECU后，请务必要将配置数据写入。\\n2、依维修手册确认车辆规格及配置的规格，如果将错误的配置数据写入车辆，ECU可能会无法正常作用，请务必写入对应该车辆的正确数据。",
