	"0x27FF3E2D4849": "编辑",
	"0x27FF3E2D484A": "所有选项的配置必须满足以下组合才能被正确执行，点击'前一页'按钮查看上一组配置，点击'下一页'按钮查看下一组配置，点击'应用'按钮采用当前界面选择的各项值并返回到设码主界面中。",
	"0x27FF3E2D484B": "选择配置项",
	"0x27FF3E2D484C": "选择设码类型",
	"0x27FF3E2D484D": "如需更改当前ECU配置，请选择'手动配置'.如需更换ECU，则选择'更换ECU'",
