	"0x27FF3E2D484F": "手动配置",
	"0x27FF3E2D4850": "更换ECU后",
	"0x27FF3E2D4851": "更换ECU前",
	"0x27FF3E2D4852": "如想立刻更换ECU,请按顺序执行以下操作:\\n1、\t关闭点火开关。\\n2、\t拆下老ECU。\\n3、\t装好新ECU。\\n4、\t打开点火开关。\\n\\n确认已按顺序执行完以上操作。\\n\\n点击'\t确定'按钮，设备将自动执行'更换ECU后'功能：写入老ECU原有配置到新更换的ECU中。\\n点击'取消'按钮,则结束当前流程，更换ECU完成后，可重新进入并选择'更换ECU后'功能以继续。",
	"0x27FF3E2D4853": "请输入12位或17位或18位VIN码",
	"0x27FF3E2D4854": "上一页",
	"0x27FF3E2D4855": "下一页",
	"0x27FF3E2D4856": "1、如果未更换ECU，选择'更换ECU前'，然后读取当前配置并保存。\\n2、如果已更换ECU，选择'更换ECU后'，然后写入之前保存的配置。注意，选择'更换ECU后'之前必须要先执行'更换ECU前'。",
