	"0x27FF3E2D4858": "Vin码输入错误",
	"0x27FF3E2D4859": "输入Vin码",
	"0x27FF3E2D485A": "请确保新ECU已安装。\\n设备将写入老ECU原有配置到新更换的ECU中.\\n确定要将此配置数据发送到新更换的控制单元吗？",
	"0x27FF3E2D485B": "Vin码格式不对",
	"0x27FF3E2D485C": "设备已保存与配置相关的数据。\\n在下一个屏幕中，如果你要将设备保存的数据写入ECU，则选择保存数据清单中的相应数据并确认其详细信息，如果信息正确，选择该行信息并点击'确认'按钮则执行写入操作。如果该行保存的信息已作废，选择该行信息并点击删除按钮可以删除该行保存的信息。",
